import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import './App.scss';

const useStyles = makeStyles(theme => ({
  root: {
    width: '100%',
    marginTop: theme.spacing(3),
    overflowX: 'auto',
  },
  table: {
    minWidth: 350,
  },
}));

function createData(date, time, team, tv, premium, free, highlights) {
  return { date, time, team, tv, premium, free, highlights };
}

const rows = [
  createData('Sept 18', '9:55am', 'Tottenham@Chelsea', 'TNT', <a href="/">TNT</a>, <a href="/">Reddit</a>, ''),
  createData('Sept 19', '9:55am', 'Dbacks@Padres', 'FOX Sports AZ', <a href="/">ABC</a>, <a href="/">Reddit</a>, <a href="/">ESPN</a>),
  createData('Sept 20', '9:55am', 'Suns@Kings', 'FOX Sports AZ', <a href="/">CBS</a>, <a href="/">Reddit</a>, ''),
  createData('Sept 21', '9:55am', 'Coyotes@Sharks', 'FOX Sports AZ', <a href="/">FOX</a>, <a href="/">Reddit</a>, ''),
  createData('Sept 22', '9:55am', 'Cardinals@Panthers', 'FOX', <a href="/">NBC</a>, <a href="/">Reddit</a>, ''),
  createData('Sept 23', '9:55am', 'Wimbledon Finals - Men\'s Singles', 'ESPN2', <a href="/">ESPN2</a>, <a href="/">Reddit</a>, ''),
];

const App = () => {
  const { table, root } = useStyles();
  return (
    <div className={`App ${root}`}>
      <Table className={table}>
        <TableHead>
          <TableRow>
            <TableCell>Date</TableCell>
            <TableCell align="right">Time</TableCell>
            <TableCell align="right">Team</TableCell>
            <TableCell align="right">TV</TableCell>
            <TableCell align="right">Premium Streams</TableCell>
            <TableCell align="right">Free Streams</TableCell>
            <TableCell align="right">Highlights</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map(({
            date, time, team, tv, premium, free, highlights,
          }) => (
              <TableRow key={date}>
                <TableCell component="th" scope="row">{date}</TableCell>
                <TableCell align="right">{time}</TableCell>
                <TableCell align="right">{team}</TableCell>
                <TableCell align="right">{tv}</TableCell>
                <TableCell align="right">{premium}</TableCell>
                <TableCell align="right">{free}</TableCell>
                <TableCell align="right">{highlights}</TableCell>
              </TableRow>
            ))}
        </TableBody>
      </Table>
    </div>
  );
};

export default App;
